<?php

namespace pocketmine\network\protocol\v331;

use pocketmine\network\protocol\Info;
use pocketmine\network\protocol\Info331;
use pocketmine\network\protocol\PEPacket;

class BiomeDefinitionListPacket extends PEPacket {

	const NETWORK_ID = Info331::BIOME_DEFINITION_LIST_PACKET;
	const PACKET_NAME = "BIOME_DEFINITION_LIST_PACKET";
	const HARDCODED_NBT_BLOB = "";
	const HARDCODED_NBT_BLOB_553 = "";

	public $namedtag;

	public function decode($playerProtocol) {
		$this->getHeader($playerProtocol);
		$this->namedtag = $this->get(true);
	}

	public function encode($playerProtocol) {
		$this->reset($playerProtocol);
		$this->put(empty($this->namedtag) ? base64_decode(
			$playerProtocol >= Info::PROTOCOL_553 ? self::HARDCODED_NBT_BLOB_553 : self::HARDCODED_NBT_BLOB) : $this->namedtag);
	}

}
